import{_ as e,c as o,o as a,a5 as t}from"./chunks/framework.CqnjdYks.js";const i="/docs/cocos/assets/ios-build-options.BVdVOp33.png",_=JSON.parse('{"title":"iOS 平台构建选项","description":"","frontmatter":{},"headers":[],"relativePath":"zh/manual/editor/publish/ios/build-options-ios.md","filePath":"zh/manual/editor/publish/ios/build-options-ios.md"}'),r={name:"zh/manual/editor/publish/ios/build-options-ios.md"},d=t('<h1 id="ios-平台构建选项" tabindex="-1">iOS 平台构建选项 <a class="header-anchor" href="#ios-平台构建选项" aria-label="Permalink to &quot;iOS 平台构建选项&quot;">​</a></h1><p><img src="'+i+'" alt="ios-build-options"></p><h2 id="配置选项" tabindex="-1">配置选项 <a class="header-anchor" href="#配置选项" aria-label="Permalink to &quot;配置选项&quot;">​</a></h2><h3 id="应用-id-名称-bundle-identifier" tabindex="-1">应用 ID 名称（Bundle Identifier） <a class="header-anchor" href="#应用-id-名称-bundle-identifier" aria-label="Permalink to &quot;应用 ID 名称（Bundle Identifier）&quot;">​</a></h3><p>包名，通常以产品网站 URL 倒序排列，如 <code>com.mycompany.myproduct</code>。</p><blockquote><p><strong>注意</strong>：包名中只能包含数字（0~9）、字母（A~Z、a~z）、中划线（-）和点（.），此外包名最后一部分必须以字母开头，不能以下划线或数字开头。详情请参考 <a href="https://developer.apple.com/documentation/bundleresources/information_property_list/cfbundleidentifier" target="_blank" rel="noreferrer">包的唯一标识符</a>。</p></blockquote><h3 id="跳过-xcode-工程的更新" tabindex="-1">跳过 Xcode 工程的更新 <a class="header-anchor" href="#跳过-xcode-工程的更新" aria-label="Permalink to &quot;跳过 Xcode 工程的更新&quot;">​</a></h3><p>默认情况下，项目构建时，会通过 <code>native/ios/</code> 下的 Xcode 工程模板更新工程，工程中的一些配置修改会用模板复原。</p><p>如果此选项勾选，则构建时，不会再更新 Xcode 工程配置。</p><p>这个选项对使用 CocoaPods，或者需要持久化对 Xcode 工程的修改十分有用。在没有勾选的情况下，每次构建都会覆盖 <code>pod install</code> 的修改. 勾选之后就不用担心被覆盖了。</p><blockquote><p><strong>注意</strong>：若勾选该项，后续若对配置进行了修改，也不会再更新 Xcode 工程。</p></blockquote><h3 id="屏幕方向" tabindex="-1">屏幕方向 <a class="header-anchor" href="#屏幕方向" aria-label="Permalink to &quot;屏幕方向&quot;">​</a></h3><p>屏幕方向目前包括 Portrait、Landscape Left、Landscape Right 三种。</p><ul><li>Portrait：屏幕直立，Home 键在下</li><li>Landscape Left：屏幕横置，Home 键在屏幕左侧</li><li>Landscape Right：屏幕横置，Home 键在屏幕右侧</li></ul><h3 id="目标系统" tabindex="-1">目标系统 <a class="header-anchor" href="#目标系统" aria-label="Permalink to &quot;目标系统&quot;">​</a></h3><p>默认启动的系统类型：</p><ul><li>iPhone OS: 真机运行。</li><li>iOS Simulator: iOS 模拟运行。</li></ul><p>这个只是默认值，可以在 Xcode 中随时修改。</p><h3 id="渲染后端" tabindex="-1">渲染后端 <a class="header-anchor" href="#渲染后端" aria-label="Permalink to &quot;渲染后端&quot;">​</a></h3><p><strong>渲染后端</strong> 目前支持 <strong>METAL</strong>，详情可参考官方文档 <a href="https://developer.apple.com/cn/metal/" target="_blank" rel="noreferrer">Metal</a>。</p><h3 id="开发者" tabindex="-1">开发者 <a class="header-anchor" href="#开发者" aria-label="Permalink to &quot;开发者&quot;">​</a></h3><p>该项用于配置构建编译 iOS 工程时的 Development Team 签名信息。若使用 Xcode 编译时，在 Xcode 中手动配置了签名信息，则以 Xcode 中的配置为准。当执行重新构建时，该项的值会覆盖 Xcode 中配置的值。</p><h3 id="目标版本" tabindex="-1">目标版本 <a class="header-anchor" href="#目标版本" aria-label="Permalink to &quot;目标版本&quot;">​</a></h3><p>该项主要用于指定发布 iOS 平台时的 iOS 软件版本，默认值为 <strong>12.0</strong>。构建后版本号会记录在发布包目录 <code>proj/cfg.cmake</code> 文件的 <code>TARGET_IOS_VERSION</code> 字段中。</p>',24),l=[d];function n(s,c,p,h,u,m){return a(),o("div",null,l)}const f=e(r,[["render",n]]);export{_ as __pageData,f as default};
